import { Link } from 'react-router-dom';
import Navbar from "../components/NavBar";

const HomePage = () => {
    return(
        <div style={{ backgroundImage: `url(${process.env.PUBLIC_URL}/HomePage.jpg)`, backgroundSize: 'cover', height: '100vh' }}>
        <Navbar></Navbar>
        </div>
    );
};

export default HomePage;
